import React, { useState } from "react";
import makeStyles from "@mui/styles/makeStyles";
import { Grid, Typography, Button } from "@mui/material";

const useStyles = makeStyles((theme) => ({
  main: {},
  info: { background: "#F4F5F7" },
  contactForm: {},
}));

export default function Contact() {
  const [active, setActive] = useState("center");
  const classes = useStyles();
  return (
    <>
      <Grid container className={classes.main}>
        <Grid container item className={classes.info} xs={6}>
          <Grid container item>
            <Typography variant="subtitle2" className={classes.infoTitle}>Adres</Typography>
            <Typography className={classes.infoText}>
              Yakuplu Mah., Dereboyu Cad., Beysan Sanayi Sitesi, No:3,
              Beylikdüzü İstanbul/Turkiye
            </Typography >
            <Typography className={classes.infoLink}>Yol Tarifi Al</Typography>
          </Grid>
          <Grid container item></Grid>
          <Grid container item></Grid>
        </Grid>

        <Grid container item className={classes.contactForm} xs={6}></Grid>

      </Grid>
    </>
  );
}
